import Login from './login';

function App() {


  return (
    <Router>
      <Routes>
        <Route path = "/" element = {<Landing />} /> {} *
        <Route path = "/login" element = {<Login />} />
        {/*<Route path = "/customer-entry-form" element = {<CustomerEntryForm />} />*/}
        <Route path = "/shopping-cart"  element = {<ShoppingCart/>} />
      </Routes>
    </Router>
  );
}

export default App;
